using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace Foundation{	/// <summary>	/// The NSScanner class is an abstract superclass of a class cluster that declares the programmatic interface for an object that scans values from an NSString object.	/// </summary>	/// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/Foundation/Classes/NSScanner_Class/index.html#//apple_ref/occ/cl/NSScanner"/>	[iOSVersion(2)]	public class NSScanner : NSObject, AnyObject, NSCopying, NSObjectProtocol	{		/// <summary>		/// Returns an NSScanner object that scans a given string.		/// </summary>		/// <param name="aString">The string to scan.</param>		[iOSVersion(2)]		[Export("scannerWithString")]		public static Self ScannerWithString(string aString) { return default(Self); }				/// <summary>		/// Returns an NSScanner object that scans a given string according to the user’s default locale.		/// </summary>		/// <param name="aString">The string to scan.</param>		[iOSVersion(2)]		[Export("localizedScannerWithString")]		public static AnyObject LocalizedScannerWithString(string aString) { return default(AnyObject); }				/// <summary>		/// Returns an NSScanner object initialized to scan a given string.		/// </summary>		/// <param name="@string">The string to scan.</param>		[iOSVersion(2)]		public NSScanner(string @string) { }				/// <summary>		/// Scans the string as long as characters from a given character set are encountered, accumulating characters into a string that’s returned by reference.		/// </summary>		/// <param name="scanSet">The set of characters to scan.</param>		/// <param name="intoString">Upon return, contains the characters scanned.</param>		[iOSVersion(2)]		[Export("scanCharactersFromSet")]		public bool ScanCharactersFromSet(NSCharacterSet scanSet, AutoreleasingUnsafePointer<string> intoString) { return default(bool); }				/// <summary>		/// Scans the string until a character from a given character set is encountered, accumulating characters into a string that’s returned by reference.		/// </summary>		/// <param name="stopSet">The set of characters up to which to scan.</param>		/// <param name="intoString">Upon return, contains the characters scanned.</param>		[iOSVersion(2)]		[Export("scanUpToCharactersFromSet")]		public bool ScanUpToCharactersFromSet(NSCharacterSet stopSet, AutoreleasingUnsafePointer<string> intoString) { return default(bool); }				/// <summary>		/// Scans for an NSDecimal value, returning a found value by reference.		/// </summary>		/// <param name="decimalValue">Upon return, contains the scanned value. See the NSDecimalNumber class specification for more information about NSDecimal values.</param>		[iOSVersion(2)]		[Export("scanDecimal")]		public bool ScanDecimal(COpaquePointer decimalValue) { return default(bool); }				/// <summary>		/// Scans for a double value, returning a found value by reference.		/// </summary>		/// <param name="doubleValue">Upon return, contains the scanned value. Contains HUGE_VAL or –HUGE_VAL on overflow, or 0.0 on underflow.</param>		[iOSVersion(2)]		[Export("scanDouble")]		public bool ScanDouble(UnsafePointer<Double> doubleValue) { return default(bool); }				/// <summary>		/// Scans for a float value, returning a found value by reference.		/// </summary>		/// <param name="floatValue">Upon return, contains the scanned value. Contains HUGE_VAL or –HUGE_VAL on overflow, or 0.0 on underflow.</param>		[iOSVersion(2)]		[Export("scanFloat")]		public bool ScanFloat(UnsafePointer<Float> floatValue) { return default(bool); }				/// <summary>		/// Scans for a double value from a hexadecimal representation, returning a found value by reference.		/// </summary>		/// <param name="result">Upon return, contains the scanned value.</param>		[iOSVersion(2)]		[Export("scanHexDouble")]		public bool ScanHexDouble(UnsafePointer<Double> result) { return default(bool); }				/// <summary>		/// Scans for a double value from a hexadecimal representation, returning a found value by reference.		/// </summary>		/// <param name="result">Upon return, contains the scanned value.</param>		[iOSVersion(2)]		[Export("scanHexFloat")]		public bool ScanHexFloat(UnsafePointer<Float> result) { return default(bool); }				/// <summary>		/// Scans for an unsigned value from a hexadecimal representation, returning a found value by reference.		/// </summary>		/// <param name="intValue">Upon return, contains the scanned value. Contains UINT_MAX on overflow.</param>		[iOSVersion(2)]		[Export("scanHexInt")]		public bool ScanHexInt(UnsafePointer<uint> intValue) { return default(bool); }				/// <summary>		/// Scans for a long long value from a hexadecimal representation, returning a found value by reference.		/// </summary>		/// <param name="result">Upon return, contains the scanned value.</param>		[iOSVersion(2)]		[Export("scanHexLongLong")]		public bool ScanHexLongLong(UnsafePointer<UInt64> result) { return default(bool); }				/// <summary>		/// Scans for an NSInteger value from a decimal representation, returning a found value by reference		/// </summary>		/// <param name="value">Upon return, contains the scanned value.</param>		[iOSVersion(2)]		[Export("scanInteger")]		public bool ScanInteger(UnsafePointer<int> value) { return default(bool); }				/// <summary>		/// Scans for an int value from a decimal representation, returning a found value by reference.		/// </summary>		/// <param name="intValue">Upon return, contains the scanned value. Contains INT_MAX or INT_MIN on overflow.</param>		[iOSVersion(2)]		[Export("scanInt")]		public bool ScanInt(UnsafePointer<int> intValue) { return default(bool); }				/// <summary>		/// Scans for a long long value from a decimal representation, returning a found value by reference.		/// </summary>		/// <param name="longLongValue">Upon return, contains the scanned value. Contains LLONG_MAX or LLONG_MIN on overflow.</param>		[iOSVersion(2)]		[Export("scanLongLong")]		public bool ScanLongLong(UnsafePointer<Int64> longLongValue) { return default(bool); }				/// <summary>		/// Scans a given string, returning an equivalent string object by reference if a match is found.		/// </summary>		/// <param name="@string">The string for which to scan at the current scan location.</param>		/// <param name="intoString">Upon return, if the receiver contains a string equivalent to string at the current scan location, contains a string equivalent to string.</param>		[iOSVersion(2)]		[Export("scanString")]		public bool ScanString(string @string, AutoreleasingUnsafePointer<string> intoString) { return default(bool); }				/// <summary>		/// Scans for an unsigned long long value from a decimal representation, returning a found value by reference.		/// </summary>		/// <param name="unsignedLongLongValue">Upon return, contains the scanned value. Contains ULLONG_MAX on overflow.</param>		[iOSVersion(7)]		[Export("scanUnsignedLongLong")]		public bool ScanUnsignedLongLong(UnsafePointer<UInt64> unsignedLongLongValue) { return default(bool); }				/// <summary>		/// Scans the string until a given string is encountered, accumulating characters into a string that’s returned by reference.		/// </summary>		/// <param name="stopString">The string to scan up to.</param>		/// <param name="intoString">Upon return, contains any characters that were scanned.</param>		[iOSVersion(2)]		[Export("scanUpToString")]		public bool ScanUpToString(string stopString, AutoreleasingUnsafePointer<string> intoString) { return default(bool); }				/// <summary>		/// Returns the string with which the receiver was created or initialized.		/// </summary>		[iOSVersion(2)]		[Export("string")]		public string String { get; private set; }				/// <summary>		/// Sets the location at which the next scan operation will begin to a given index.		/// </summary>		[iOSVersion(2)]		[Export("scanLocation")]		public int ScanLocation { get; set; }				/// <summary>		/// Sets whether the receiver is case sensitive when scanning characters.		/// </summary>		[iOSVersion(2)]		[Export("caseSensitive")]		public bool CaseSensitive { get; set; }				/// <summary>		/// Sets the set of characters to ignore when scanning for a value representation.		/// </summary>		[iOSVersion(2)]		[Export("charactersToBeSkipped")]		public NSCharacterSet CharactersToBeSkipped { get; set; }				/// <summary>		/// Sets the receiver’s locale to a given locale.		/// </summary>		[iOSVersion(2)]		[Export("locale")]		public AnyObject Locale { get; set; }	}}